import logo from './logo.svg';
import './App.css';
import 'leaflet/dist/leaflet.css';
import mapConfig from'./configPosition.json'

import { MapContainer, TileLayer, Marker, Popup, Polygon } from 'react-leaflet'
function App() {
  const purpleOptions = { color: 'purple' }
  const position = [13.824869, 109.146137]
  const rectangle = [
    [51.49, -0.08],
    [51.5, -0.06],
  ]
  return (
    <div className="App">
      <MapContainer   style={{ height: '100vh', width: '100wh' }} center={position} zoom={11} scrollWheelZoom={false}>
  <TileLayer
    attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
  />

  <Marker  center={position} position={position}>
    <Popup>
      A pretty CSS3 popup. <br /> Easily customizable.
    </Popup>
  </Marker>
  <Polygon pathOptions={purpleOptions} positions={rectangle} />
</MapContainer>
    </div>
  );
}

export default App;
